import React, { useState, useEffect } from "react";
import {
  Container,
  Button,
  Form,
  FormGroup,
  Label,
  Input,
  FormText,
} from "reactstrap";

const Home = () => {
  const [login, setLogin] = useState("");
  const [password, setPassword] = useState("");
  useEffect(() => {}, []);

  return (
    <Container>
      <h1>Home</h1>
      <Form>
        <FormGroup>
          <Label for="exampleEmail">Email</Label>
          <Input type="login" name="login" id="login" placeholder="JohnDoe" />
        </FormGroup>
        <FormGroup>
          <Label for="examplePassword">Password</Label>
          <Input
            type="password"
            name="password"
            id="Password"
            placeholder="aaaaa"
          />
        </FormGroup>
      </Form>
    </Container>
  );
};
export default Home;
